import React from 'react';
import Input from './Input';

const InputGroup = () => {
  return (
    <div className="input-group">
      <Input category={'current-savings'} >Current Savings ($)</Input>
      <Input category={'yearly-contribution'} >Yearly Savings ($)</Input>
    </div>
  );
};

export default InputGroup;
